const {
  max,
  scaleLinear,
  scaleBand,
  scaleOrdinal,
  interpolateRainbow: interpolate,
  axisTop,
  format,
  easeLinear,
} = d3;

const years = Object.keys(data).map((year) => parseInt(year, 10));
const countries = Object.keys(data[years[0]]);

// to animate the text it is helpful to have a reference to the emissions from the previous year
years.forEach((year, i) => {
  countries.forEach((country) => {
    const current = data[year][country];
    const previous =
      i === 0 ? data[year][country] : data[year - 1][country].current;
    data[year][country] = {
      current,
      previous,
    };
  });
});

const duration = 350; // milliseconds for each year
const dimensions = {
  width: 800,
  height: 480,
  margin: {
    top: 20,
    right: 120,
    bottom: 10,
    left: 10,
  },
};

dimensions.boundedWidth =
  dimensions.width - (dimensions.margin.left + dimensions.margin.right);
dimensions.boundedHeight =
  dimensions.height - (dimensions.margin.top + dimensions.margin.bottom);

const formatTick = format(".2~s");
const formatEmissions = format(",.0d");

const colorScale = scaleOrdinal()
  .domain(countries)
  .range(countries.map((_, i, { length }) => interpolate(i / length)));

// domain depends on the input data
const xScale = scaleLinear().range([0, dimensions.boundedWidth]);
const yScale = scaleBand().range([0, dimensions.boundedHeight]).padding(0.25);

const xAxis = axisTop(xScale)
  .ticks(5)
  .tickFormat((d) => formatTick(d));

const main = d3.select("body").append("main");

main
  .append("h1")
  .text("Which countries are historically responsible for climate change?");
main
  .append("p")
  .text(
    "Cumulative CO2 emissions from fossil fuels, land use and forestry, 1850-2021 (million tonnes)."
  );

const article = main.append("article");

const button = article.append("button").text("Run animation");

const wrapper = article
  .append("svg")
  .attr("viewBox", `0 0 ${dimensions.width} ${dimensions.height}`)
  .attr("width", dimensions.width)
  .attr("height", dimensions.height);

wrapper
  .append("defs")
  .append("clipPath")
  .attr("id", "clip-data")
  .append("rect")
  .attr("width", dimensions.width) // dimensions.width to avoid cropping the labels
  .attr("height", dimensions.boundedHeight);

const bounds = wrapper
  .append("g")
  .attr(
    "transform",
    `translate(${dimensions.margin.left} ${dimensions.margin.top})`
  );

const currentYear = bounds
  .append("text")
  .attr("fill", "currentColor")
  .attr("font-size", "48")
  .attr("font-weight", "bold")
  .attr("text-anchor", "end")
  .attr("x", dimensions.boundedWidth + dimensions.margin.right - 5)
  .attr("y", dimensions.boundedHeight - 5);

bounds
  .append("path")
  .attr("fill", "none")
  .attr("stroke", "currentColor")
  .attr("stroke-width", "1")
  .attr("d", `M -0.5 0 v ${dimensions.boundedHeight}`);

const axisGroup = bounds.append("g");
const countriesGroup = bounds.append("g").attr("clip-path", "url(#clip-data)");

function plotData({ year = years[0], runAnimation = true } = {}) {
  const dataYear = Object.entries(data[year])
    .sort(
      ([, emissionsA], [, emissionsB]) =>
        emissionsB.current - emissionsA.current
    )
    .slice(0, 10);

  xScale.domain([0, max(dataYear, ([, emissions]) => emissions.current)]);
  yScale.domain(dataYear.map(([country]) => country));

  // common transition for all bars
  const transition = d3.transition().duration(duration).ease(easeLinear);

  const update = countriesGroup
    .selectAll("g")
    .data(dataYear, ([country]) => country);

  const enter = update.enter();
  const exit = update.exit();

  // update selection: modify existing bars & labels 
  update
    .transition(transition)
    .attr("transform", ([country]) => `translate(0 ${yScale(country)})`);

  update
    .select("rect")
    .transition(transition)
    .attr("width", ([, emissions]) => xScale(emissions.current));

  update
    .select("text")
    .transition(transition)
    .attr(
      "transform",
      ([, emissions]) => `translate(${xScale(emissions.current) + 5} 0)`
    );

  update
    .select("text tspan:last-of-type")
    .transition(transition)
    .textTween(([, emissions]) => (t) => { // t [0, 1]
      const { current, previous } = emissions;
      return formatEmissions(previous + (current - previous) * t);
    });

  // enter selection: nest labels and rectangles in group elements
  const enterGroups = enter.append("g");

  enterGroups
    .attr("transform", `translate(0 ${dimensions.boundedHeight})`)
    .transition(transition)
    .duration(year === years[0] ? 0 : duration)
    .attr("transform", ([country]) => `translate(0 ${yScale(country)})`);

  const enterLabel = enterGroups
    .append("text")
    .attr("fill", "currentColor")
    .attr("y", yScale.bandwidth() / 2 - 2)
    .attr(
      "transform",
      ([, emissions]) => `translate(${xScale(emissions.current) + 5} 0)`
    );

  enterLabel
    .append("tspan")
    .attr("font-weight", "bold")
    .attr("font-size", "16")
    .text(([country]) => country);

  enterLabel
    .append("tspan")
    .attr("font-size", "14")
    .attr("x", "0")
    .attr("dy", 16)
    .text(([, emissions]) => formatEmissions(emissions.current));

  enterGroups
    .append("rect")
    .attr("fill", ([country]) => colorScale(country))
    .attr("height", yScale.bandwidth())
    .attr("width", ([, emissions]) => xScale(emissions.current));

  // exit selection: move bars out of the clipped area
  exit
    .transition(transition)
    .attr("transform", `translate(0 ${dimensions.boundedHeight})`)
    .remove();

  axisGroup.transition(transition).call(xAxis);

  axisGroup.selectAll("line").remove();
  axisGroup.selectAll("path").remove(); // remove all path elements including the previous grid lines

  axisGroup
    .selectAll("g.tick")
    .append("path")
    .attr("fill", "none")
    .attr("stroke", "currentColor")
    .attr("stroke-width", "0.2")
    .attr("d", `M 0 0 v ${dimensions.boundedHeight}`);

  axisGroup
    .selectAll("text")
    .attr("fill", "currentColor")
    .attr("font-size", "12");

  currentYear.text(year);

  // run the animation if instructed by the button **and** if theres is a new year to plot
  transition.on("end", () => {
    if (runAnimation && year < years[years.length - 1]) {
      plotData({ year: year + 1 });
    }
  });
}

plotData({ runAnimation: false });

button.on(
  "click",
  (e) => {
    plotData();
    d3.select(e.target)
      .style("opacity", "1")
      .transition()
      .duration(250)
      .style("opacity", "0")
      .remove();
  },
  {
    once: true,
  }
);

main
  .append("p")
  .style("text-align", "right")
  .text("Source: ")
  .append("a")
  .attr("href", href)
  .text("Carbon Brief");


